import React from 'react';
import './Footer.css';

export default function Footer() {
  return (
    <footer className="footer">
      <div className="container">
      < a href="https://www.larkzvisuals.com.au/" target="_blank" rel="noopener noreferrer">Larkz Visuals</a>
      </div>
    </footer>
  );
}
